import React from 'react';
import ReactDom from 'react-dom';

const myName = "Talha Bajwa";

function myFunction() {
  Math.random() * 10;
}

ReactDom.render(
  <>
    <h1>My name is {myName}.</h1>
    <h2>My lucky number is {myFunction}. </h2>
  </>,
  document.getElementById('root')
);
